import React, { Component } from "react";
import { render } from "react-dom";
import DesiderIcon from './Desider_Icon.svg';

class Icon extends Component {

    constructor(props) {

        super(props);

        this.state = {};

    }

    render() {

        return (

            <img src = {DesiderIcon}></img>

        );   

    }

}

export default Icon;
